import React from "react";
import Swiper from "swiper";
//Material UI
import Button from "@material-ui/core/Button";

import DeleteSweepOutlinedIcon from "@material-ui/icons/DeleteSweepOutlined";
import ForwardIcon from "@material-ui/icons/Forward";
import NoteAddOutlinedIcon from "@material-ui/icons/NoteAddOutlined";

//Local Components
import makeStyles from "./Options_styles";

const Options = ({ setting_boolean, set_Setting_bolean }) => {
	const styles = makeStyles();

	const handle_note_button = () => {
		set_Setting_bolean(!setting_boolean);
	};

	const handle_delete_button = () => {
		set_Setting_boolean(!setting_boolean);
	};

	const handle_move_button = () => {
		set_Setting_boolean(!setting_boolean);
	};

	return (
		<div>
			<Button className={makeStyles.note_add} onClick={handle_note_button}>
				<NoteAddOutlinedIcon />
				Note
			</Button>
			<Button onClick={handle_delete_button}>
				<DeleteSweepOutlinedIcon />
				Delete
			</Button>
			<Button onClick={handle_move_button}>
				<ForwardIcon />
				Move
			</Button>
		</div>
	);
};

export default Options;
